# Definition for a binary tree node.# class TreeNode:#     def __init__(self, x):#         self.val = x#         self.left = None#         self.right = Noneclass Solution:    def sumNumbers(self, root):        """        :type root: TreeNode        :rtype: int        """        self.res=[]        def helper(root,path):            if root.left==None and root.right==None:                self.res.append(path)                return            if root.left:                helper(root.left,path+str(root.left.val))            if root.right:                helper(root.right,path+str(root.right.val))            return        if not root:            return 0        helper(root,str(root.val))        ans=0        for item in self.res:            ans+=int(item)        return ans